import React, { useEffect, useState } from 'react';

import Button from 'react-bootstrap/Button';







 function FromLoginF() {
     const [email, setEmail] = useState('')
     const [name, setName] = useState('')
     const [rendertext, settext] = useState()
useEffect(() => {
if(name === "")
return ;

  if(name === "yassin") {
      settext(true)
  }else {
    settext(false)
  }

}, [name])


useEffect(() => {
  if(email === "") 
  return;
  console.log("component Did update")
}, [email, name])


      function handleEmail(e) {
        setEmail(e.target.value)
      }

      function handlName(e) {
   setName(e.target.value)

      }


      return (
        <div>
   <input value={email} placeholder='email' onChange={handleEmail}/>
   <input value={name} placeholder='name'  onChange={handlName}/>
 
            {
              rendertext  ? (
                <div><h1>Component writes yassin</h1></div>
              ) : (


                <div >
                  <Button variant="primary" size="lg"> {name} </Button>
                  <h1> {name !== '' ? "Component writes not yassin" : ""} </h1>
                  
                  </div>
              )
            }
      
        </div>
      )
      
}


export default FromLoginF
